    return (
        <Link to={`/login/product/${item.name}`}>
            <ListItemWrapper>
                <TitleItem>s
                    ListItem = {item.name}
                </TitleItem>
                <ImageProduct src={`http://localhost:5000/${item.image}`} alt="" />
            </ListItemWrapper>
        </Link>
    )
}

export default ListItem;
